import {Container, View, Input, Icon} from '../../../atoms'


const TextIcon = ({placeholder}) => {

    return (
        <Container position="relative">
            <Icon name="search" position="absolute" left="15px" top="10px"/>
            <Input placeholder="What are you looking for?" width="500px" padding="5px 30px 5px 50px"/>
        </Container>
    )
}

export default TextIcon
